// src/components/HomePage.js
import React from 'react';
import Navbar from './Navbar';

const HomePage = () => {
  return (
    <div>
      <Navbar />
      <h1>Welcome to Centralized Court Judgments Portal</h1>
      <p>Access court judgments easily and efficiently.</p>
      <input type="text" placeholder="Search by case title..." />
      <button>Search</button>
    </div>
  );
};

export default HomePage;
